const SignIn = (props) => {
  return (
    <form>
      <label htmlFor="email" id="email">
        Email
      </label>
      <input type="text" id="email"></input>
      <label htmlFor="password" id="password">
        Password
      </label>
      <input type="text" id="email"></input>
    </form>
  );
};

export default SignIn;
